--
-- Table structure for table `t_vital_organization`
--

DROP TABLE IF EXISTS `t_vital_organization`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_vital_organization` (
  `id` varchar(50) NOT NULL,
  `target_id` varchar(50) DEFAULT NULL COMMENT '授权对象ID，所以该机构树，既包含了系统全局的组织机构，也包含各个工程的组织机构，target_id即是工程ID',
  `org_code` varchar(50) DEFAULT NULL COMMENT '4位随机字符串，不重复，可以修改',
  `org_name` varchar(50) DEFAULT NULL COMMENT '机构名称',
  `org_type` varchar(50) DEFAULT NULL COMMENT '单位/部门/用户组/无（虚拟节点）',
  `parent_id` varchar(50) DEFAULT NULL COMMENT '根结点，ROOT',
  `children_count` int(11) DEFAULT '0',
  `sid` varchar(8) DEFAULT NULL COMMENT '短主键，8位的随机字符串，用于生成path路径',
  `path` text COMMENT '因为id是uuid，太长，所以用object_id作为path的代码',
  `serial` int(11) DEFAULT '0' COMMENT '排序顺序号',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `create_user` varchar(50) DEFAULT NULL,
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `update_user` varchar(50) DEFAULT NULL,
  `description` varchar(500) DEFAULT NULL,
  `parent_ids` varchar(200) DEFAULT NULL,
  `org_addr` varchar(500) DEFAULT NULL,
  `username` varchar(100) DEFAULT NULL,
