CREATE TABLE `t_vital_role` (
  `id` varchar(50) NOT NULL,
  `role_name` varchar(50) DEFAULT NULL,
  `domain_id` varchar(50) DEFAULT NULL,
  `global_permissions` varchar(50) DEFAULT 'GENERAL' COMMENT '全局权限：supervisor/administrator/general supervisor：超级管理员，一切权限不受限，主要用于系统维护，一般不交付给业务人员 administrator：系统管理员，也是交付给客户的最高权限，具有绝大部分系统管理权限，除一些影响系统运行的配置项之外（比如：资源树、内置参数、平台层的一些配置功能），所有业务功能不受限 general：根据授权表来决定权限',
  `innate` bit(1) DEFAULT b'0' COMMENT '是否内置角色，内置角色除超级管理员外，其他任何角色不能修改和删除',
  `tags` varchar(200) DEFAULT '0' COMMENT '角色的标签，用于对角色分类',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `create_user` varchar(50) DEFAULT NULL,
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `update_user` varchar(50) DEFAULT NULL,
  `description` varchar(500) DEFAULT NULL,
  `role_code` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
